window.bookSummaryJSON = "<p><b>To: Roomie Collective (Tilly, Sabre, Moose, Frank)</b></p> <p>Hey guys! Just wanted to let you know that I’ll be in Athens for four days next week.</p> <p><b>From: Tilly</b></p> <p>Oooh, Athens! Pretty place, but dusty. You going to meet a hot Greek?</p> <p><b>To: Roomie Collective (Tilly, Sabre, Moose, Frank)</b></p> <p>You could say that. It’s for a magazine interview. Some up-and-coming rich bachelor.</p> <p><b>From: Moose</b></p> <p>Pictures! We demand pictures of this smokin’ Greek. Also, will want full deets on your “interview”.</p> <p><b>To: Roomie Collective (Tilly, Sabre, Moose, Frank)</b></p> <p>It really is an interview, I swear.</p> <p><b>From: Moose</b></p> <p>Girl, you don’t have to pretend with us. But if Mr. Adonis sweeps you off your feet and whisks you away to his private island, we demand visitation rights.</p> <p><b>To: Roomie Collective (Tilly, Sabre, Moose, Frank)</b></p> <p>Insert appropriate eyeroll here. That sort of stuff only happens in movies, not to people like me.</p> <p><b>From: Tilly</b></p> <p>My money’s on you, Thyra.</p> <p><b>From: Moose</b></p> <p>My money’s on the shmexy Greek. Mmrowr.</p>"; 
